import {Link} from "react-router-dom";
//import "../styles/Home.css"

const Home = () => {
    return (
        <div className="container px-4 text-center">
            <div className="row gx-5">
                <div className="col">
                    <div class="p-9">Найти кому помочь</div>    
                </div>
                <div className="col">
                    <div class="p-3">Найти кто может помочь</div>  
                </div>
            </div>
        </div>
    );
};

export default Home;
